import React, { Component } from 'react';
import styled from 'styled-components';

const Section = styled.section`
  display: block;
  margin-top: 0px;
  width: 35vw;
`
const Title = styled.h2`
  color: #000000;
`
const Text = styled.p`
`

const NameInputLabel = styled.p`
  margin-top: 50px;
`

const NameInputField = styled.input`
  width: 35vw;
  height: 40px;
  border:1px solid #D3D3D3;
  padding-left: 10px;
  transition: 0.5s;
  border-radius: 5px;

  &:focus {
    outline: none;
    border: 1px solid #000000;
  }
`



class Idea extends Component {
  render() {
    return (
      <>
      <Section>
        <Title>
          Pitch your idea to the landlord
        </Title>
        <Text>
          To send an enquiry, landlords require some information about your idea for the space. If they like your idea, you'll be able to ask any questions and set up a viewing.
        </Text>
        <NameInputLabel>
          Name your idea
        </NameInputLabel>
        <NameInputField
          type='text'
          placeholder='ex. Custom made ice cream'
        ></NameInputField>

      </Section>

      </>
    )
  }
}

export default Idea;
